import React, {useState, useRef} from "react";
import Clubs from "./components/Clubs";
import {Container} from "./styles";

export default function App() {

    const seating = [{
        type: 'Club',
        totalSeats: 20,
        seatInARow: 10,
        maxSelection: 10,
        userSelection: 3,
    }
        ,
        {
            type: 'Executive',
            totalSeats: 30,
            seatInARow: 10,
            maxSelection: 10,
            userSelection: 3,
        }];


    return (
        <Container>
            {seating?.map(({type, totalSeats, seatInARow, maxSelection}) => {

                return (<React.Fragment>
                    <Clubs
                        key={type}
                        label={type}
                        seatInARow={seatInARow}
                        maxSelection={maxSelection}
                        totalSeats={totalSeats}>
                        userSelection={userSelection}>

                    </Clubs>
                    <hr/>
                </React.Fragment>)

            })}
        </Container>
    );
}
